records.addlTxt:
Defendant Vanetta M McDonald in court with attorney Eryn M Menden.  David John Behm appeared for the State of Wisconsin.  Defendant enters a guilty plea as to Counts 1 and 3.  Court finds defendant guilty.  Court conducts plea colloquy with defendant.  State makes sentencing recommendation.  Defense makes sentencing recommendation.  Defendant makes statement.The Defendant was sentenced to the following:

IMPOSED AND STAYED SENTENCE OF:   

COUNT 1:

JAIL: 60 days straight (CREDIT - 8 days).  Consecutive to any other sentence.  

TERM OF PROBATION:  1 YEAR

CONDITIONS OF PROBATION:  
*AODA Assessment and follow through with any treatment recommended;
*Absolute Sobriety; Random U.A.'s; 
*No Use or Possession of alcohol, controlled substances or drug paraphernalia;
*No Use or Possession of prescription drugs without a valid prescription;
*Any valid prescription drugs must be taken only in the manner in which they are prescribed;
*Inform Agent of all prescriptions;
*Follow through with any treatment and/or counseling recommended by Agent;
*No contact with:  co-defendant.  

COURT COSTS:  $253.00 (to be paid as a condition of probation);

DNA SURCHARGE:  $200.00 (to be paid as a condition of probation);
Defendant to provide DNA sample, if not yet provided, immediately if in custody otherwise within (3) business days at the Waukesha County Sheriff Department.

CONDITION TIME: 20 dayts, STAYED; to be used at agent's discretion.  Agent to determine with or without non working hours.  



IMPOSED AND STAYED SENTENCE OF:   

COUNT 3:

JAIL: 60 days straight.  Consecutive to Count 1.

TERM OF PROBATION:  1 YEAR

CONDITIONS OF PROBATION:  
*Same as Count 1. 

COURT COSTS:  $243.00 (to be paid as a condition of probation);

DNA SURCHARGE:  $200.00 (to be paid as a condition of probation);
Defendant to provide DNA sample, if not yet provided, immediately if in custody otherwise within (3) business days at the Waukesha County Sheriff Department.
